function openCity(e,t){var c,n,o;for(n=document.getElementsByClassName("tabcontent"),c=0;c<n.length;c++)n[c].style.display="none";for(o=document.getElementsByClassName("tablinks"),c=0;c<o.length;c++)o[c].className=o[c].className.replace(" active","");document.getElementById(t).style.display="block",e.currentTarget.className+=" active"}const checkbox=document.getElementById("checkbox"),body=document.getElementsByTagName("body")[0];checkbox.addEventListener("change",(()=>checkbox.checked?body.style.overflow="hidden":body.style.overflow="scroll"));